import '../App.css';
import './Account.css';

const Account = (props) => {
    return (
        <div className="Account flex">
            <a className="Account-button" href="/create">Sign Up</a>
            <a className="Account-button" href="/login">Log In</a>
        </div>
    );
}

export default Account;
